tml>'),(15,1,1,'HTML JETWIFI 5GHC','radius','<!DOCTYPE html>\n<html lang=\"en\">\n<head>\n    <meta charset=\"UTF-8\">\n    <title>JetWiFi Voucher - AJ6473</title>\n    <style>\n        body {\n            display: flex;\n            justify-content: center;\n            align-items: center;\n            height: 100vh;\n            background-color: #f0f0f0;\n            margin: 0;\n            font-family: \'Arial Black\', Gadget, sans-serif;\n        }\n\n        .voucher-card {\n            width: 550px;\n            height: 300px;\n            background: linear-gradient(130deg, #4b0082 55%, #d800d8 55%);\n            color: white;\n            position: relative;\n            padding: 15px 25px;\n            box-sizing: border-box;\n            border-radius: 12px;\n            box-shadow: 0 10px 25px rgba(0,0,0,0.3);\n            overflow: hidden;\n            display: flex;\n            flex-direction: column;\n            justify-content: space-between;\n        }\n\n        /* Large \'5\' Watermark */\n        .watermark {\n            position: absolute;\n            top: 45%;\n            left: 50%;\n            transform: translate(-50%, -50%);\n            font-size: 280px;\n            font-weight: 900;\n            color: rgba(255, 140, 0, 0.22);\n            z-index: 0;\n            pointer-events: none;\n        }\n\n        .header {\n            font-size: 34px;\n            margin: 0;\n            z-index: 1;\n            letter-spacing: 1px;\n        }\n\n        .main-row {\n            display: flex;\n            justify-content: space-between;\n            align-items: center;\n            z-index: 1;\n        }\n\n        .login-details {\n            font-size: 24px;\n            line-height: 1.6;\n        }\n\n        .credential {\n            font-family: \'Courier New\', Courier, monospace;\n            background: rgba(0,0,0,0.2);\n            padding: 0 5px;\n            border-radius: 3px;\n            font-weight: 900;\n        }\n\